import React, { useState } from 'react'
import Head from 'next/head'
import { useRouter } from 'next/router'
import puppeteer from 'puppeteer'


const print = async () => {
  const browser = await puppeteer.launch()
  const page = await browser.newPage()
  await page.goto('https://myip.ms/')
  await page.screenshot({ path: 'print.png' })

  await browser.close;
}




const Home: React.FC = () => {

  const [inputIP, setInputIP] = useState('')
  const router = useRouter()

  function handleClick(text) {
    alert(text)
  }


  return (
    <div className="container">
      <Head>
        <title>Primefox - Get Range IP</title>
      </Head>

      <div className="card">
        <h3>Buscar . . .</h3>
        <input type="text" placeholder="Digite Host ou IP" onChange={e => setInputIP(e.target.value)} />
        {/* <button type="submit" onClick={() => router.push(`/getrange/${inputIP}`)}>Get Range</button> */}
        <button type="submit" onClick={() => router.push(`/getrange/${inputIP}`)}>Get Range</button>
      </div>

      <div className="bottom">
        <a href="http://primefox.com.br">Primefox</a>
      </div>

    </div>
  )
}

export default Home;
